const{JobOrder:JobOrder,Invoice:Invoice,PayRequestJo:PayRequestJo,CostPayRequest:CostPayRequest}=require("../../../models");module.exports=async(req,res)=>{const jobOrder=await JobOrder.findAll();if(!jobOrder)return res.status(404).json({status:"error",message:"data not found"});let jobOrderArray=[];for(var i=0;i<jobOrder.length;i++){const joPayRequest=await PayRequestJo.findAll({where:{jo_number:jobOrder.jo_number},include:[CostPayRequest]});jobOrderArray.push(joPayRequest)}return res.json({status:"success",data:jobOrderArray})};